import React, { useState, useEffect } from 'react';
import supabase from '../../supabaseClient';
import './AdminDashboard.css';

function AdminDashboard() {
  const [bookings, setBookings] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');
  const [authenticated, setAuthenticated] = useState(false);
  const [password, setPassword] = useState('');
  const [devMode, setDevMode] = useState(false);
  const [editingStatus, setEditingStatus] = useState(null);
  const [tempStatus, setTempStatus] = useState('');

  const statusOptions = [
    'Booked',
    'In Transit',
    'Out for Delivery',
    'Delivered',
    'On Hold',
    'Cancelled'
  ];

  useEffect(() => {
    if (supabase.supabaseUrl === 'https://placeholder-url.supabase.co') {
      setDevMode(true);
    }
    if (authenticated) {
      fetchBookings();
    }
  }, [authenticated]);

  // Simple authentication - in a real app, use a more secure method
  const handleLogin = (e) => {
    e.preventDefault();
    // This is a placeholder - in a real app, use proper authentication
    if (password === 'admin123') {
      setAuthenticated(true);
    } else {
      setError('Invalid password');
    }
  };

  const handleStatusChange = async (bookingId, newStatus) => {
    try {
      if (devMode) {
        // Update local state for dev mode
        setBookings(bookings.map(booking => 
          booking.id === bookingId ? { ...booking, status: newStatus } : booking
        ));
        return;
      }

      const { error } = await supabase
        .from('bookings')
        .update({ status: newStatus })
        .eq('id', bookingId);

      if (error) throw error;

      // Refresh bookings after update
      fetchBookings();
    } catch (err) {
      console.error('Error updating status:', err);
      setError('Failed to update status');
    } finally {
      setEditingStatus(null);
    }
  };

  const startEditing = (bookingId, currentStatus) => {
    setEditingStatus(bookingId);
    setTempStatus(currentStatus);
  };

  const saveStatus = (bookingId) => {
    handleStatusChange(bookingId, tempStatus);
  };

  const handleKeyDown = (e, bookingId) => {
    if (e.key === 'Enter') {
      saveStatus(bookingId);
    } else if (e.key === 'Escape') {
      setEditingStatus(null);
    }
  };

  const fetchBookings = async () => {
    try {
      setLoading(true);

      // If in development mode with placeholder credentials, use mock data
      if (devMode) {
        // Simulate API delay
        setTimeout(() => {
          const mockBookings = [
            {
              id: 1,
              booking_id: 'BOOK-123456',
              booking_date: new Date().toISOString(),
              customer_name: 'John Doe',
              customer_phone: '+91 9876543210',
              destination_country: 'United States',
              parcel_weight: 2.5,
              selected_courier: 'DHL',
              selected_service: 'Express',
              price_to_customer: 3500,
              status: 'Booked'
            },
            {
              id: 2,
              booking_id: 'BOOK-654321',
              booking_date: new Date(Date.now() - 86400000).toISOString(), // Yesterday
              customer_name: 'Jane Smith',
              customer_phone: '+91 9876543211',
              destination_country: 'United Kingdom',
              parcel_weight: 1.5,
              selected_courier: 'FedEx',
              selected_service: 'Priority',
              price_to_customer: 2800,
              status: 'In Transit'
            }
          ];
          setBookings(mockBookings);
          setLoading(false);
        }, 1000);
        return;
      }

      const { data, error } = await supabase
        .from('bookings')
        .select('*, customer_aadhar, customer_pan, our_cost, base_price')
        .order('booking_date', { ascending: false });

      if (error) throw error;

      setBookings(data || []);
    } catch (err) {
      console.error('Error fetching bookings:', err);
      setError('Failed to fetch bookings');
    } finally {
      setLoading(false);
    }
  };

  if (!authenticated) {
    return (
      <div className="admin-container">
        <header className="App-header">
          <h1>🔐 Admin Dashboard</h1>
          <p>Please login to access the dashboard</p>
        </header>

        <main className="main-content">
          {devMode && (
            <div className="dev-mode-message">
              <p>⚠️ Development Mode: Supabase is not configured with real credentials.</p>
              <p>Login will use mock data. Use password: <strong>admin123</strong></p>
            </div>
          )}

          <div className="login-form">
            {error && <div className="error-message"><p>❌ {error}</p></div>}

            <form onSubmit={handleLogin}>
              <div className="form-group">
                <label htmlFor="password">Admin Password:</label>
                <input
                  type="password"
                  id="password"
                  value={password}
                  onChange={(e) => setPassword(e.target.value)}
                  required
                />
              </div>
              <button type="submit" className="login-button">Login</button>
            </form>
          </div>
        </main>

        <footer className="App-footer">
          <p>Built with ❤️ for efficient courier management</p>
        </footer>
      </div>
    );
  }

  return (
    <div className="admin-container">
      <header className="App-header">
        <h1>📊 Admin Dashboard</h1>
        <p>Manage your bookings</p>
      </header>

      <main className="main-content">
        {devMode && (
          <div className="dev-mode-message">
            <p>⚠️ Development Mode: Displaying mock booking data.</p>
            <p>Configure your .env.local file with real Supabase credentials for production use.</p>
          </div>
        )}

        {error && <div className="error-message"><p>❌ {error}</p></div>}

        {loading ? (
          <div className="loading-message">
            <p>Loading bookings...</p>
          </div>
        ) : (
          <div className="bookings-container">
            <h2>Recent Bookings</h2>

            {bookings.length === 0 ? (
              <p className="no-bookings">No bookings found</p>
            ) : (
              <div className="bookings-table-wrapper">
                <table className="bookings-table">
                  <thead>
                    <tr>
                      <th>Booking ID</th>
                      <th>Date</th>
                      <th>Customer</th>
                      <th>Aadhar</th>
                      <th>PAN</th>
                      <th>Destination</th>
                      <th>Courier</th>
                      <th>Base Price</th>
                      <th>Our Cost</th>
                      <th>Price to Customer</th>
                      <th>Status</th>
                    </tr>
                  </thead>
                  <tbody>
                    {bookings.map((booking) => (
                      <tr key={booking.id}>
                        <td>{booking.booking_id}</td>
                        <td>{new Date(booking.booking_date).toLocaleDateString()}</td>
                        <td>{booking.customer_name}</td>
                        <td>{booking.customer_aadhar || 'N/A'}</td>
                        <td>{booking.customer_pan || 'N/A'}</td>
                        <td>{booking.destination_country}</td>
                        <td>{booking.selected_courier}</td>
                        <td>₹{booking.base_price}</td>
                        <td>₹{booking.our_cost}</td>
                        <td>₹{booking.price_to_customer}</td>
                        <td>
                          {editingStatus === booking.id ? (
                            <div className="status-edit-container">
                              <select
                                value={tempStatus}
                                onChange={(e) => setTempStatus(e.target.value)}
                                onKeyDown={(e) => handleKeyDown(e, booking.id)}
                                className="status-select"
                                autoFocus
                              >
                                {statusOptions.map(option => (
                                  <option key={option} value={option}>
                                    {option}
                                  </option>
                                ))}
                              </select>
                              <button 
                                onClick={() => saveStatus(booking.id)}
                                className="status-save-button"
                                title="Save"
                              >
                                ✓
                              </button>
                              <button 
                                onClick={() => setEditingStatus(null)}
                                className="status-cancel-button"
                                title="Cancel"
                              >
                                ✕
                              </button>
                            </div>
                          ) : (
                            <div 
                              className={`status-badge status-${booking.status.toLowerCase()}`}
                              onClick={() => startEditing(booking.id, booking.status)}
                              title="Click to edit status"
                            >
                              {booking.status}
                            </div>
                          )}
                        </td>
                      </tr>
                    ))}
                  </tbody>
                </table>
              </div>
            )}
          </div>
        )}
      </main>

      <footer className="App-footer">
        <p>Built with ❤️ for efficient courier management</p>
      </footer>
    </div>
  );
}

export default AdminDashboard;
